		var angle;
		var shape = this.leftyoke;
		var diferencia;
		var diferenciab;
		
		
		
		var mouseMove = function () {
		
			var rads = Math.atan2(stage.mouseY - shape.y, stage.mouseX - shape.x);
		
			angle = rads * (180 / Math.PI) - offset;
		
			if (angle > -180 && angle < 180) {
		
				shape.rotation = angle;
		
				console.log("angle: " + angle);
		
				angle = angle.toFixed(1);
				//id = document.getElementById("labelprueba");
				//id.innerHTML = angle;
		
				diferenciab = pinfinitosaca - angle;
		
		
				var diferenciab = pinfinitosaca - angle;
				if (diferenciab > -0.25 && diferenciab <= 0.25) {
					that.lenteb_mc.play(1);
				}
		
				var posicion_mc = that.lenteb_mc.currentFrame;
		
				if (posicion_mc == 45) {
					that.lenteb_mc.gotoAndPlay(47);
				}
			}
		};
		
		
		var offset = 0;
		
		stage.addEventListener("stagemousedown", function () {
		
			stage.addEventListener("stagemousemove", mouseMove);
		
			// Determine initial offset, and take off shape rotation
		
			var rads = Math.atan2(stage.mouseY - shape.y, stage.mouseX - shape.x);
		
			offset = rads * (180 / Math.PI) - shape.rotation;
		
			mouseMove();
		});
		
		stage.addEventListener("stagemouseup", function () {
		
			stage.removeEventListener("stagemousemove", mouseMove);
		
		});
		
		
		
		
		// control de aumento de tiempo y de poder rotatorio
		var timera = null;
		var timerb = null;
		var tiempo = 0;
		var numero = (Math.random()) / 10;
		var resto;
		
		
		this.tiempoini_btn.on("click", iniciaraumento.bind(this));
		
		function iniciaraumento() {
			timera = setInterval(actualizar, 5000, "JavaScript");
			//timerb = setInterval(revisar,2000, "JavaScript"); // Cada segundo
		}
		
		function actualizar() {
			tiempo = tiempo + 5;
		
			if (tiempo < 5000) {
				id = document.getElementById("tiempossal_txt");
				id.innerHTML = tiempo;
		
				//calcula el poder rotatorio 
				pendiente = Math.exp(pendienteHCla * tiempo);
				psacaHCla = pinfinitosaca + (pcerosaca - pinfinitosaca) * pendiente;
				resto = psacaHCla % 2;
		
				if (resto == 0) {
					psacaHCla = psacaHCla + numero;
					psacaHCla = psacaHCla.toFixed(1);
		
					id = document.getElementById("display_txt"); //control interno
					id.innerHTML = psacaHCla; //control interno
				} else {
					psacaHCla = psacaHCla - numero;
					psacaHCla = psacaHCla.toFixed(1);
		
					id = document.getElementById("display_txt"); //control interno
					id.innerHTML = psacaHCla; //control interno
				}
			}
			//id = document.getElementById("labelprueba");
			//id.innerHTML = angle;
		
			if (tiempo == 5000) {
				clearInterval(timera);
			}
		}
		
		this.termopausa_btn.on("click", detener.bind(this));
		
		function detener() {
			clearInterval(timera);
			tiempo = 0;
			id = document.getElementById("tiempossal_txt");
			id.innerHTML = tiempo;
		
			id = document.getElementById("display_txt"); //control interno
			id.innerHTML = "----"; //control interno
		}
